import Node from './node';
import CalendarBlock from './calendar';

class Page extends Node {
    constructor() {
        super('main', {classList: 'app__content content'});
    }
}

export default class CalendarPage extends Page {
    constructor() {
        super();

        this.booking = new CalendarBlock();
        this.booking.start();

        // this.buttonNext = new Button('button', 'Далее');
